import React, { useState, useCallback } from "react";
import ReactDOM from "react-dom/client";
import "./App.css";

const Button = ({ text, onClick, style }) => (
  <button style={style} onClick={onClick}>
    {text}
  </button>
);

const buttonStyles = {
  backgroundColor: "#61dbfb",
  padding: 10,
  border: "none",
  borderRadius: 5,
  margin: "3px auto",
  cursor: "pointer",
  fontSize: 22,
  color: "white",
};

const Header = ({ data }) => {
  const {
    welcome,
    title,
    subtitle,
    author: { firstName, lastName },
    date,
  } = data;

  return (
    <header>
      <div className="header-wrapper">
        <h1>{welcome}</h1>
        <h2>{title}</h2>
        <h3>{subtitle}</h3>
        <p>
          {firstName} {lastName}
        </p>
        <small>{date}</small>
        <p>Select a country for your next holiday</p>
      </div>{" "}
    </header>
  );
};

const Message = ({ message }) => {
  return (
    <div>
      <h1>{message}</h1>
    </div>
  );
};

const Login = () => {
  return (
    <div>
      <h3>Please Login</h3>
    </div>
  );
};

const Welcome = () => {
  return (
    <div>
      <h1>Welcome to 30 Days of React</h1>
    </div>
  );
};

const TechList = ({ techs }) => {
  return techs.map((tech) => <li key={tech}>{tech}</li>);
};

const Main = ({
  techs,
  greetPeople,
  handleTime,
  loggedIn,
  handleLogin,
  message,
}) => {
  const status = loggedIn ? <Welcome /> : <Login />;

  return (
    <main>
      <div className="main-wrapper">
        <p>Prerequesite to get started react.js:</p>
        <ul>
          <TechList techs={techs} />
        </ul>
        {techs.length === 3 && (
          <p>You have all the prerequisite courses to get started React</p>
        )}
        <div>
          <Button text="ShowTime" onClick={handleTime} style={buttonStyles} />
          <Button
            text="Greet People"
            onClick={greetPeople}
            style={buttonStyles}
          />
          {!loggedIn && (
            <p>
              Please login to access more information about 30 Days of React
              challenge
            </p>
          )}
        </div>
        <div style={{ margin: 30 }}>
          <Button
            text={loggedIn ? "Logout" : "Login"}
            style={buttonStyles}
            onClick={handleLogin}
          />
          <br />
          {status}
        </div>
        <Message message={message} />
      </div>
    </main>
  );
};

const Footer = ({ date }) => (
  <footer>
    <div className="footer-wrapper">
      <p>Copyright {date.getFullYear()}</p>
    </div>
  </footer>
);

const App = () => {
  const [loggedIn, setLoggedIn] = useState(false);
  const [techs] = useState(["HTML", "CSS", "JS"]);
  const [message, setMessage] = useState(
    "Click show time or Greet people to change me"
  );
  const handleLogin = () => setLoggedIn((prev) => !prev);

  const showDate = (time) => {
    const months = [
      "January",
      "February",
      "March",
      "April",
      "May",
      "June",
      "July",
      "August",
      "September",
      "October",
      "November",
      "December",
    ];
    const month = months[time.getMonth()].slice(0, 3);
    const year = time.getFullYear();
    const date = time.getDate();
    return `${month} ${date}, ${year}`;
  };

  const handleTime = () => {
    setMessage(showDate(new Date()));
  };

  const greetPeople = () => {
    setMessage("Welcome to 30 Days Of React Challenge, 2025");
  };

  const headerData = {
    welcome: "30 Days Of React",
    title: "Getting Started React",
    subtitle: "JavaScript Library",
    author: {
      firstName: "Thomas",
      lastName: "Nguyen",
    },
    date: "May 11, 2020",
  };

  return (
    <div className="app">
      <Header data={headerData} />
      <Main
        techs={techs}
        handleTime={handleTime}
        greetPeople={greetPeople}
        loggedIn={loggedIn}
        handleLogin={handleLogin}
        message={message}
      />
      <Footer date={new Date()} />
    </div>
  );
};

const rootElement = document.getElementById("root");
const root = ReactDOM.createRoot(rootElement);
root.render(<App />);
